import React, { ReactElement } from "react";
import styled from "styled-components/native";
import { View, H1, TextInput, Button, Text } from "../../styles";
import { TouchableOpacity } from "react-native";

const ProfileDiv = styled(View)`
  flex: 1;
  padding: 100px;
  align-items: center;
`;

const ProfileImage = styled.Image`
  width: 150px;
  height: 150px;
`;

const EditProfile = styled.TouchableOpacity`
  padding-top: 10px;
  padding-bottom: 10px;
  padding-right: 20px;
  padding-left: 20px;
  border-radius: 5px;
  font-size: 1.25rem;
  font-weight: bold;
  border: 1px;
  border-radius: 5px;
  border-color: ${(props: any) => props.theme.text};
  color: ${(props: any) => props.theme.text};
  width: 250px;
  text-align: center;
  margin-top: 10px;
  margin-bottom: 10px;
`;

interface Props {}

export default function Profile({}: Props): ReactElement {
  return (
    <ProfileDiv>
      <ProfileImage source={require("../../assets/base/person.png")} />
      <EditProfile>Edit Profile</EditProfile>
    </ProfileDiv>
  );
}
